import Card from './Card';
function Team() {
    const cardsData = [
        {
          backgroundImage: '/images/Image-Wrapper.png',
          profileImage: '/images/Worker-Image.png',
          title: 'Software Developers',
          priceRange: '$1,000 - $2,500 /month (avg.)'
        },
        {
          backgroundImage: '/images/Image-Wrapper2.png',
          profileImage: '/images/Worker-Image2.png',
          title: 'Designers',
          priceRange: '$800 - $1,800 /month (avg.)'
        },
        {
          backgroundImage: '/images/Image-Wrapper3.png',
          profileImage: '/images/Worker-Image3.png',
          title: 'Marketing Experts',
          priceRange: '$900 - $2,000 /month (avg.)'
        },
        {
            backgroundImage: '/images/Image-Wrapper4.png',
            profileImage: '/images/Worker-Image4.png',
            title: 'Virtual Assistants',
            priceRange: '$600 - $1,500 /month (avg.)'
          }
      ];
      const cardsData2 = [
        {
          backgroundImage: '/images/Image-Wrapper5.png',
          profileImage: '/images/Worker-Image5.png',
          title: 'Data Analysts',
          priceRange: '$1,000 - $2,500 /month (avg.)'
        },
        {
          backgroundImage: '/images/Image-Wrapper6.png',
          profileImage: '/images/Worker-Image6.png',
          title: 'Customer Support',
          priceRange: '$800 - $1,800 /month (avg.)'
        },
        {
          backgroundImage: '/images/Image-Wrapper7.png',
          profileImage: '/images/Worker-Image7.png',
          title: 'Sales Representatives',
          priceRange: '$900 - $2,000 /month (avg.)'
        },
        {
            backgroundImage: '/images/Image-Wrapper8.png',
            profileImage: '/images/Worker-Image8.png',
            title: 'Content Writers',
            priceRange: '$700 - $1,800 /month (avg.)'
          }
      ];

  return (
    <div className="w-full max-w-[1440px] mx-auto min-h-[800px] xl:h-[1326px] py-[56px] xl:py-[112px] px-4 sm:px-8 xl:px-[64px] flex flex-col gap-[40px] xl:gap-[80px]" id="roles">
      {/* Header Section */}
      <div className="w-full max-w-[768px] xl:w-[768px] xl:h-[204px] flex flex-col gap-[16px] text-center xl:text-left">
        <div className="font-semibold text-[14px] leading-[21px] text-[#666666] uppercase tracking-wider">
          Roles
        </div>
        <div className="flex flex-col gap-[24px]">
          <h2 className="text-[28px] sm:text-[36px] xl:text-[48px] font-semibold leading-[1.2] xl:leading-[57.6px] text-[#000000]">
            High-caliber talent{" "}
            <span className="text-[#666666]">for essential roles</span>
          </h2>
          <p className="text-[16px] xl:text-[18px] font-normal leading-[24px] xl:leading-[27px] text-[#666666] max-w-[600px] xl:max-w-none mx-auto xl:mx-0">
            Here are several examples of the job roles we can fill with amazing
            remote workers.
          </p>
        </div>
      </div>

      {/* Cards Grid */}
      <div className="w-full max-w-[1312px] xl:w-[1312px] mx-auto flex flex-col gap-[40px] xl:gap-[96px]">
        {/* First Row */}
        <div className="w-full">
          <div className="grid grid-cols-1 sm:grid-cols-2 xl:grid-cols-4 gap-[24px] xl:gap-[32px] justify-items-center">
            {cardsData.map((card, index) => (
              <Card
                key={index}
                backgroundImage={card.backgroundImage}
                profileImage={card.profileImage}
                title={card.title}
                priceRange={card.priceRange}
              />
            ))}
          </div>
        </div>

        {/* Second Row */}
        <div className="w-full">
          <div className="grid grid-cols-1 sm:grid-cols-2 xl:grid-cols-4 gap-[24px] xl:gap-[32px] justify-items-center">
            {cardsData2.map((card, index) => (
              <Card
                key={index}
                backgroundImage={card.backgroundImage}
                profileImage={card.profileImage}
                title={card.title}
                priceRange={card.priceRange}
              />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}
export default Team;
